  return (
    <footer className="bg-dark text-left text-lg-start">
    <div className="text-center p-3">
      <NavLink to="/recipes" style={{
        textDecoration: 'none',
        fontSize: 'white'
      }}>Recipes.com Home</NavLink>
    </div>
  </footer>
  )
} 

